import React from "react";

const ProductForm = () => {
  return (
    <div className="Product_form_container">
      <div className="Product_card">
        <form>
          <input type="text" />
          <input type="number" />
          <input type="number" />
          <input type="number" />
          <input type="text" />
        </form>
      </div>
    </div>
  );
};

export default ProductForm;
